// contracts/GameItem.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

import "./LicenseTools.sol";

contract LicenseToken is ERC721Enumerable, AccessControl {
    /**
    CONSTANTS
    */
    bytes32 public constant LICENSE_MANAGER_ROLE =
        keccak256("LICENSE_MANAGER_ROLE");

    using Counters for Counters.Counter;

    using LicenseTools for LicensesData;

    /**
    EVENTS
    */

    /**
     * @notice event for license activation
     * @dev Explain to a developer any extra details
     * @param licenseId license id
     */
    event LicenseActive(uint256 licenseId);

    /**
     * @notice event for license update
     * @dev Explain to a developer any extra details
     * @param licenseId license id
     */
    event LicenseUpdated(uint256 licenseId);

    //Modifiers

    /**
     * @notice Modifier
     * @dev Modifier for License Manager only
     */
    modifier onlyLicenseManager() {
        require(hasRole(LICENSE_MANAGER_ROLE, _msgSender()), "UNAUTH");
        _;
    }

    /**
     * @notice Modifier
     * @dev Modifier for only existing token id
     */
    modifier onlyExistedToken(uint256 tokenId) {
        require(_exists(tokenId), "NOTFNDL");
        _;
    }

    Counters.Counter private _tokenIds;

    LicensesData licensesData;

    // mapping(uint256 => LicenseInfo) registeredLicenses;

    constructor() ERC721("License", "LVC") {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(LICENSE_MANAGER_ROLE, _msgSender());
    }

    /**
     * @notice supportsInterface function
     * @dev Needed for inherit ECR721 token
     * @param interfaceId nonce
     * @return supportsInterface execution
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721Enumerable, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    /**
     * @notice Create license
     * @dev Create new ECR721 token
     * Requirements:
     * - the caller must have the `MANAGER_ROLE`.
     * @param licenseOwner owner address
     * @param servicesIdsPool license servicesIdsPool
     * @param licenseOwner owner address
     * @param numberOfMonths number Of Months
     * @return the hash of the license
     */
    function createLicense(
        address licenseOwner,
        uint256 servicesIdsPool,
        LicenseType licenseType,
        uint256 numberOfMonths
    ) public onlyLicenseManager returns (uint256) {
        _tokenIds.increment();

        uint256 newLicenseId = _tokenIds.current();
        _safeMint(licenseOwner, newLicenseId);
        require(
            licensesData.insert(
                newLicenseId,
                servicesIdsPool,
                licenseType,
                numberOfMonths
            ),
            "EXILIC"
        );
        return newLicenseId;
    }

    /**
     * @notice Reset license
     * @dev Reset ECR721 token
     * Requirements:
     * - the caller must have the `MANAGER_ROLE`.
     * @param licenseId licenseId
     * @param servicesIdsPool license servicesIdsPool
     * @param licenseType owner address
     * @param numberOfMonths number Of Months
     */
    function resetLicense(
        address licenseOwner,
        uint256 licenseId,
        uint256 servicesIdsPool,
        LicenseType licenseType,
        uint256 numberOfMonths
    ) public onlyLicenseManager onlyExistedToken(licenseId) {
        require(ownerOf(licenseId) == licenseOwner, "OWNB");
        licensesData.insert(
            licenseId,
            servicesIdsPool,
            licenseType,
            numberOfMonths
        );
        emit LicenseUpdated(licenseId);
    }

    /**
     * @notice Update license
     * @dev Update existing ECR721 token
     * Requirements:
     * - the caller must have the `MANAGER_ROLE`.
     * - the token Id must exist.
     * @param licenseId license Id
     * @param servicesIdsPool license servicesIdsPool
     * @param addedMonths number Of Months
     */
    function updateLicense(
        address licenseOwner,
        uint256 licenseId,
        uint256 servicesIdsPool,
        uint256 addedMonths
    ) public onlyLicenseManager onlyExistedToken(licenseId) {
        require(ownerOf(licenseId) == licenseOwner, "OWNB");
        require(
            licensesData.update(licenseId, servicesIdsPool, addedMonths),
            "LICEXP"
        );
        emit LicenseUpdated(licenseId);
    }

    /**
     * @notice burn license owner can burn licence
     * @dev Explain to a developer any extra details
     * @param licenseId license id
     */
    function burn(uint256 licenseId) public onlyExistedToken(licenseId) {
        require(ownerOf(licenseId) == _msgSender(), "OWNB");
        _burn(licenseId);
        delete licensesData.registeredLicenses[licenseId];
    }

    /**
     * @notice Activate license
     * @dev Explain to a developer any extra details
     * @param licenseId license id
     */
    function activate(uint256 licenseId) public onlyExistedToken(licenseId) {
        require(ownerOf(licenseId) == _msgSender(), "OWNA");
        require(licensesData.activate(licenseId), "ACT");
        emit LicenseActive(licenseId);
    }

    /**
     * @notice check if license is activated
     * @dev Explain to a developer any extra details
     * @param licenseId license id
     * @return true if license is active and not expired
     */
    function isLicenseActive(uint256 licenseId)
        public
        view
        onlyExistedToken(licenseId)
        returns (bool)
    {
        return licensesData.isLicenseActive(licenseId);
    }

    /**
     * @notice get license
     * @dev Explain to a developer any extra details
     * @param licenseId license id
     * @return LicenseInfo struct
     */
    function getLicense(uint256 licenseId)
        public
        view
        onlyExistedToken(licenseId)
        returns (LicenseInfo memory)
    {
        return licensesData.registeredLicenses[licenseId];
    }

    /**
     * @notice check if user can user a service form the license id
     * @dev Explain to a developer any extra details
     * @param user user address
     * @param licenseId license id
     * @param serviceId service id to check
     * @return LicenseInfo struct
     */
    function isUserAllowToUseService(
        address user,
        uint256 licenseId,
        uint256 serviceId
    ) public view onlyExistedToken(licenseId) returns (bool) {
        require(licensesData.isLicenseActive(licenseId), "INVAL");
        return
            licensesData.isUserAllowToUseService(
                user,
                ownerOf(licenseId),
                licenseId,
                serviceId
            );
    }
}

